import { Link } from "react-router-dom";

function Products() {
  return (
    <>
      <h1>The Products Page.</h1>
      <ul>
        <li><Link></Link>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
      </ul>
    </>
  );
}

export default Products;
